import React from 'react';

const LogIn = props => {

    return(
        <div>
            <form>
                <label>E-mail:</label>
                <input type="text"/>
                <br/>
                <label>Password</label>
                <input type="password"/>
            </form>
        </div>
    )
}

export default LogIn;
